import React from 'react';

function Profile() {
  const user = {
    name: 'John Doe',
    age: 30, 
    bio: 'Software developer'
  };

  return (
    <div className="profile">
      <h1>{user.name}'s Profile</h1>

      <p>Age: {user.age} years</p>

      <p>Bio: {user.bio}</p>

    </div>
  );
}

export default Profile;
